  \"This Ocean Uses Atlas Project is an innovative partnership between NOAA's National
  Marine Protected Areas Center and Marine Conservation Biology Institute. The Project
  was designed to enhance ocean management through geospatial data on the full range
  of significant human uses of the ocean environment from the shorelines of California
  to the EEZ boundary. The data were gathered from regional ocean experts and users
  through participatory GIS methods. For more information on the project scope, background
  and related data products, please visit http://marinecadastre.gov/oceanuses/ or
  http://marineprotectedareas.noaa.gov/dataanalysis/atlas_ca/.\",\n\t\"license_title\":
